import React from 'react';
import {Form,Button} from 'react-bootstrap';
import {Link} from 'react-router-dom';

function AutoScreen() {
  return (
    <div>
      <Form className="container my-2" expand="lg">
        <Form.Group>
        <Form.Label htmlFor="Email">Email:</Form.Label>
        <Form.Control type="email" name="Email" placeholder='Email'/>

        <Form.Label htmlFor="password">Password:</Form.Label>
        <Form.Control type="password" name='password' placeholder='Password'/>
        
        <button type='submit' className='my-2 btn btn-success' variant="success" expand="lg">Send</button>
        <p className='container'>Hesab ın yok mu?</p><Link to="/signup">Sign up</Link>
        </Form.Group>
      </Form>
    </div>
  )
}

export default AutoScreen;
